import React, { useEffect, useState } from "react";
import { getDispatch } from "../services/api";

function Dispatch({ token }) {
  const [dispatchList, setDispatchList] = useState([]);

  useEffect(() => {
    const fetchDispatch = async () => {
      try {
        const response = await getDispatch(token, "2024-11-01");
        setDispatchList(response.data);
      } catch (error) {
        console.error("Failed to fetch dispatch data", error);
      }
    };

    fetchDispatch();
  }, [token]);

  return (
    <div>
      <h1>Dispatch Page</h1>
      {dispatchList.length > 0 ? (
        <ul>
          {dispatchList.map((dispatch) => (
            <li key={dispatch.id}>
              {dispatch.busNumber} - {dispatch.actualStartTime}
            </li>
          ))}
        </ul>
      ) : (
        <p>No dispatch data available</p>
      )}
    </div>
  );
}

export default Dispatch;
